CREATE TABLE public.asset (
	id serial NOT NULL,
	symbol varchar NOT NULL,
	company_name varchar NOT NULL,
	exchange varchar NOT NULL,
	is_valid boolean DEFAULT true NOT NULL,
	CONSTRAINT asset_pk PRIMARY KEY (id),
	CONSTRAINT asset_unique UNIQUE (symbol)
);



CREATE TABLE public.user_asset (
	id serial NOT NULL,
	symbol varchar(10) NOT NULL,
	display_order int NOT NULL,
	CONSTRAINT user_asset_pk PRIMARY KEY (id),
	CONSTRAINT user_asset_unique UNIQUE (symbol)
);

CREATE TABLE public."users" (
	id serial NOT NULL,
	login varchar NOT NULL,
	"password" varchar NOT NULL,
	CONSTRAINT user_pk PRIMARY KEY (id),
	CONSTRAINT user_unique UNIQUE (login)
);

